DKD1@(corpilb1)(cfg-sync In Sync)(Active)(/Common)(tmos)#  list ltm pool /infr1/*
ltm pool /infr1/heathrowapp-app-infr1-corp-37532-3-8080-pool {
    load-balancing-mode least-connections-node
    members {
        /infr1/tcsv0x4ij:8080 {
            address 10.252.72.76
            session monitor-enabled
            state down
        }
        /infr1/tcsv0x4ik:8080 {
            address 10.252.72.77
            session monitor-enabled
            state down
        }
    }
    monitor tcsrv-tcp-probe and default-inband-probe
    partition infr1
    reselect-tries 1
    service-down-action reselect
}
ltm pool /infr1/heathrowapp-data-heathrowapp-1010-gflo-infr1-corp-10334-pool {
    load-balancing-mode least-connections-node
    members {
        /infr1/gflo0x85:10334 {
            address 10.252.67.27
            session monitor-enabled
            state up
        }
        /infr1/gflo0x86:10334 {
            address 10.252.67.28
            session monitor-enabled
            state up
        }
    }
    monitor tcp-3sec-probe
    partition infr1
    reselect-tries 1
}
